long long int number_converter(long long int number, long long int base)
{
    long long int reminder, converted=0, k=1;
    while(number!=0)
    {//Using pow() gives wrong answers sometimes. Therefore, k is used to multiply
        //with power of 10
        reminder=number%base;
        number=number/base;
        converted=converted+reminder*k;
        k=k*10;

    }
    return converted;
}

